            1 => array('id' => '2', 'question_ar' => 'هل استخدام التطبيق بحاجة الى تسجيل دخول ؟', 'answer_ar' => 'لا ، فقط حمل التطبيق واستفيد من خدماته مباشرة', 'question_en' => 'Do I need to register to use the application?', 'answer_en' => 'No, just download the application and benefit from its services directly.', 'question_fr' => 'Dois-je m\'inscrire pours utiliser l’application?', 'answer_fr' => 'Non, il suffit de télécharger l\'application et de profiter directement de ses services.', 'frequently_asked_question_type_id' => '1'),
            2 => array('id' => '3', 'question_ar' => 'هل يمكن ارسال التطبيق الى صديق ؟', 'answer_ar' => 'نعم ، وبكل سهولة يمكنك مشاركة أي صديق لهذا التطبيق لتعم الفائدة على الجميع', 'question_en' => 'Can I send the application to a friend?', 'answer_en' => 'Yes, you can share this application easily with any friend for the benefit of all.', 'question_fr' => 'Puis-je envoyer la candidature à UN ami?', 'answer_fr' => 'Oui, vous pouvez partager cette application facilement avec n\'importe quel ami pour le bénéfice de tous.', 'frequently_asked_question_type_id' => '1'),
            3 => array('id' => '4', 'question_ar' => 'هل يمكن حجز مواعيد عند الأطباء من خلال التطبيق ؟', 'answer_ar' => 'نعم ممكن حجز المواعيد من خلال التطبيق بالاتصال المباشر مع الجهة الطبية أو حجز موعد الكترونيا لدى الجهات الطبية التي تستخدم نظام الحجز الكترونيا', 'question_en' => 'Can I schedule a doctor\'s appointment through the application?', 'answer_en' => 'Yes, you can schedule appointments through the application by contacting the medical facility directly, or schedule an appointment online at any medical facility that uses the electronic booking system.', 'question_fr' => 'Puis-je prendre rendez-vous chez le médecin via l’application?', 'answer_fr' => 'Oui, vous pouvez prendre rendez-vous via l\'application en contactant directement l\'établissement médical, ou prendre rendez-vous en ligne dans n\'importe quel établissement médical utilisant le système de réservation électronique.', 'frequently_asked_question_type_id' => '1'),
            4 => array('id' => '5', 'question_ar' => 'هل يمكن شراء الأدوية من خلال التطبيق ؟', 'answer_ar' => 'نعم ممكن شراء الأدوية من خلال التطبيق لدى الصيدليات التي تستخدم نظام البيع أون لاين', 'question_en' => 'Can I buy medicine through the application?', 'answer_en' => 'No, because this application is not an alternative to consulting a medical body.', 'question_fr' => 'Puis-je acheter des médicaments via l’application?', 'answer_fr' => 'Non, car cette application n\'est pas une alternative à la consultation d\'un organisme médical.', 'frequently_asked_question_type_id' => '1'),
            5 => array('id' => '6', 'question_ar' => 'هل يمكن تلقي العلاج من خلال التطبيق ؟', 'answer_ar' => 'لا ، لأن التطبيق ليس بديلا عن مراجعة الجهة الطبية', 'question_en' => 'Can I buy medicine through the application?', 'answer_en' => 'No, because this application is not an alternative to consulting a medical body.', 'question_fr' => 'L\'application est-elle disponible dans tous les pays?', 'answer_fr' => 'Oui, l\'application est disponible dans tous les pays arabes.', 'frequently_asked_question_type_id' => '1'),
            6 => array('id' => '7', 'question_ar' => 'هل التطبيق متوفر في كل الدول ؟', 'answer_ar' => 'نعم التطبيق متوفر في كل الدول العربية', 'question_en' => 'Is the application available in all countries?', 'answer_en' => 'Yes, the application is available in all Arab countries.', 'question_fr' => 'Puis-je contacter UN organisme médical qui existe dans un pays autre que le mien?', 'answer_fr' => 'Oui, vous pouvez le faire facilement. Vous n\'avez qu\'à utiliser le service de tourisme médical disponible dans l\'application, puis vous pouvez choisir n\'importe quel organisme médical du pays avec lequel vous souhaitez entrer en contact.', 'frequently_asked_question_type_id' => '1'),
            7 => array('id' => '8', 'question_ar' => 'هل يمكن التواصل مع جهة طبية في بلد آخر غير بلدي ؟', 'answer_ar' => 'نعم يمكن ذلك وبكل سهولة ، فما عليك سوى استخدام خدمة السياحة العلاجية المتوفرة في التطبيق وبعدها يمكن اختيار أي جهة طبية في الدولة التي تحب ان تتواصل معها', 'question_en' => 'Can I contact a medical body that exists in a country other than mine?', 'answer_en' => 'Yes, you can do that easily. You only have to use the medical tourism service that\'s available in the application, and then you can choose any medical body in the country that you would like to contact with.', 'question_fr' => 'Est-il possible de communiquer avec une autorité médicale dans un pays autre que le mien ?', 'answer_fr' => 'Oui, c\'est possible en toute simplicité, il vous suffit d\'utiliser le service de tourisme médical disponible dans l\'application, puis vous pouvez choisir n\'importe quelle autorité médicale du pays avec lequel vous souhaitez communiquer.', 'frequently_asked_question_type_id' => '1'),
            8 => array('id' => '9', 'question_ar' => 'هل تقييم التطبيق من قبلي مهم ؟', 'answer_ar' => 'نعم تقييمك للتطبيق مهم لأنه يعكس حقيقة استفادتك من التطبيق ويحفز المواطن العربي على استخدام التطبيق لتعم الفائدة ويساعد ادارة التطبيق على تطويره', 'question_en' => 'Is my evaluation of this application important?', 'answer_en' => 'Yes, your evaluation of this application is important because it reflects the fact that you benefited from the application, it motivates the Arab citizen to use the application to have widely shared benefits, and helps the application administration to develop it.', 'question_fr' => 'Mon évaluation de cette candidature est-elle importante?', 'answer_fr' => 'Oui, votre évaluation de cette application est importante car elle reflète le fait que vous avez bénéficié de l\'application, elle motive le citoyen arabe à utiliser l\'application pour avoir des avantages largement partagés et aide l\'administration de l\'application à la développer.', 'frequently_asked_question_type_id' => '1'),
            9 => array('id' => '10', 'question_ar' => 'ما هو نوع الهاتف المطلوب استخدامه للتطبيق ؟', 'answer_ar' => 'أي نوع من الهواتف الذكية', 'question_en' => 'What kind of phone needed to use the application?', 'answer_en' => 'Any kind of smart phones can be used.', 'question_fr' => 'Quel type de téléphone faut-il pours utiliser l’application?', 'answer_fr' => 'N\'importe quel type de téléphone intelligent peut être utilisé.', 'frequently_asked_question_type_id' => '1'),
            10 => array('id' => '11', 'question_ar' => 'كيف تم اشتراكي في التطبيق ؟', 'answer_ar' => 'ادارة التطبيق حريصة على اتاحة الفرصة لكل جهة طبية أو طبية مساندة في الوطن العربي وتعمل في القطاع الخاص ان يكون مشتركا في التطبيق دون تمييز', 'question_en' => 'How did I subscribe to the application?', 'answer_en' => 'The application\'s administration is keen to provide the opportunity to every medical body or supporting medical body in the Arab world that work in the private sector to become a subscriber to the application without any discrimination.', 'question_fr' => 'Comment ai-je souscrit à l’application?', 'answer_fr' => 'L\'administration de l\'application tient à offrir la possibilité à chaque organisme médical ou organisme médical de soutien du monde arabe qui travaille dans le secteur privé de s\'abonner à l\'application sans aucune discrimination', 'frequently_asked_question_type_id' => '2'),
            11 => array('id' => '12', 'question_ar' => 'ومن أين حصلتم على بياناتي ؟', 'answer_ar' => 'بياناتكم ليست سرية وهي منشورة من قبلكم ومن قبل الجهات التأمينية المعتمدين لديها ، واستخدمناها لاشتراكم في التطبيق بعد تدقيقها المبدئي', 'question_en' => 'Where did you get my data?', 'answer_en' => 'Your data is published by you and we used it to involve you in the application after initial auditing by the available official authorities', 'question_fr' => 'Où avez-vous obtenu mes données?', 'answer_fr' => 'Vos données sont publiées par vous et nous les avons utilisées pour vous impliquer dans la candidature après un premier audit par les autorités officielles disponibles', 'frequently_asked_question_type_id' => '2'),
            12 => array('id' => '13', 'question_ar' => 'من يدقق بياناتي ويتأكد من صحتها ؟', 'answer_ar' => 'المشترك نفسه عند تحميل التطبيق هو من يتأكد من صحة بياناته ويقوم بتعديلها بنفسه كلما دعت الحاجة الى التعديل.', 'question_en' => 'Who audits my data and ascertain its validity?', 'answer_en' => 'The subscriber will check his data and modify it when downloading the application', 'question_fr' => 'Qui audite mes données et vérifie leur validité?', 'answer_fr' => 'L\'abonné vérifiera ses données et les modifiera lors du téléchargement de l\'application', 'frequently_asked_question_type_id' => '2'),
            13 => array('id' => '14', 'question_ar' => 'هل استخدام المشترك للتطبيق مجانا ؟', 'answer_ar' => 'نعم مجانا', 'question_en' => 'Is the usage of this application for free?', 'answer_en' => 'Yes, it\'s for free', 'question_fr' => 'L\'utilisation de cette application est-elle gratuite?', 'answer_fr' => 'Oui, c\'est gratuit', 'frequently_asked_question_type_id' => '2'),
            14 => array('id' => '15', 'question_ar' => 'هل استخدام التطبيق بحاجة الى تسجيل دخول ؟', 'answer_ar' => 'لا ، فقط حمل تطبيق المشترك واستفيد من خدماته مباشرة', 'question_en' => 'Do I need to register to use the application?', 'answer_en' => 'No, you can download the application to benefit from its services directly', 'question_fr' => 'Dois-je m\'inscrire pour utiliser l’application?', 'answer_fr' => 'Non, vous pouvez télécharger l\'application pour bénéficier directement de ses services', 'frequently_asked_question_type_id' => '2'),
            15 => array('id' => '16', 'question_ar' => 'هل يمكن ارسال التطبيق الى صديق ؟', 'answer_ar' => 'نعم ، وبكل سهولة يمكنك مشاركة أي صديق لهذا التطبيق لتعم الفائدة على الجميع', 'question_en' => 'Can I send the application to a friend?', 'answer_en' => 'Yes, you can share this application easily with any friend for the benefit of all', 'question_fr' => 'Puis-je envoyer la candidature à UN ami?', 'answer_fr' => 'Oui, vous pouvez partager cette application facilement avec n\'importe quel ami pour le bénéfice de tous', 'frequently_asked_question_type_id' => '2'),
